import axios from 'axios';
let response
export const signin=(data)=>
{
    response= axios.post(`http://localhost:5001/api/users/signin`,{data})
      .then(res => {
          return res;
      })
}
export const login=async(data)=>
{
    axios.post(`http://localhost:5001/api/users/login`,{data}).then(res => {
          console.log(res)
          return res;
      })
}
